pragma solidity ^0.8.7;

contract PetSanctuary{
    enum AnimalKind {Fish,Cat,Dog,Rabbit,Parrot}
    AnimalKind animalKind;
    address public owner;
    constructor(){
        owner=msg.sender;
    }
    modifier onlyOwner(){
        require(msg.sender == owner, 'Only owner can give shelter ');
        _;
    }
}

